        "title": "Higgs Boson (The God Particle) and Higgs Field Explained in Simple Words",
        "description": "The Higgs boson is a wave, ripple or disturbance in an invisible, all-permeating field called the Higgs field. In the year 1964, Peter Higgs, Fran√ßois Englert and four other scientists proposed a rather unique idea to explain why certain particles had mass. They hypothesized that the entire universe is filled with an invisible, all-permeating field that gives mass to all elementary particles.\n\nThe field in question is called the Higgs field. A wave, ripple or disturbance in that field is therefore called the Higgs boson, or the Higgs particle.\n\nThis theory suggests that particles do not have a mass of their own; rather, they get their mass by interacting with the Higgs field. How heavy a particle is will be determined by how strongly a particle interacts with the Higgs field. Electrons, quarks and other elementary particles interact with the Higgs field in different ways and therefore have different masses. Photons, however, don‚Äôt interact with the field, and thus have no mass. \n\n#higgsboson #quantumphysics #particles \n\nReferences\n\nhttps://home.cern/science/physics/higgs-boson/what\nhttps://www.damtp.cam.ac.uk/user/tong/whatisqft.html\nhttps://home.cern/science/physics/higgs-boson\n\n\nOriginal Article Link: https://www.scienceabc.com/pure-sciences/what-is-the-higgs-boson.html\n\nIf you wish to buy/license this video, please write to us at admin@scienceabc.com.\n\nVoice Over Artist: John Staughton ( https://www.fiverr.com/jswildwood )\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com/abc_science\n\nFollow us on Facebook!\nhttps://facebook.com/sciabc\n\nFollow us on Instagram!\nhttps://www.instagram.com/scienceabcofficial/ \n\nFollow us on LinkedIn!\nhttps://www.linkedin.com/company/scienceabc\n\nFollow our Website!\nhttps://www.scienceabc.com",
